import React, { Component } from 'react';
import Head from '../components/Head';
import { ReactComponent as Map } from '../components/Map.svg';

export default class Learn extends Component {
    constructor(props) {
        super(props);
        this.state = {
            login: "",
            password: "",
            role: "",
            loginError: ""
        };

        this.handleClick = this.handleClick.bind(this);
        this.handleChoose = this.handleChoose.bind(this);
        // this.handleChange = this.handleChange.bind(this);
    }


    handleClick(event) {
        console.log(event.target)

        event.target.style.fill = "#ff0000";
    }


    handleChoose(event) {
        console.log(event.target.id);
        var r = document.getElementById(event.target.className);
        r.style.display="inline"
        console.log(r);

    }


    render() {
        return (
            <div>
				<Head />
				<div id="body">
					<Map onClick={this.handleClick}/>
					<ul id="layers">
						<li className="region" onClick={this.handleChoose}>Районы</li>
						<li className="city" onClick={this.handleChoose}>Города</li>
						<li className="river" onClick={this.handleChoose}>Реки</li>
						<li className="place" onClick={this.handleChoose}>Места</li>
					</ul>
				</div>
			</div>
        );
    }
}
